  false,\n\t\"url\": null,\n\t\"notes\": \"Benthic habitat maps of the nearshore marine
  environment of St. John, U.S. Virgin Islands were created by visual interpretation
  of remotely sensed imagery. The objective of this effort, conducted by NOAA's Center
  for Coastal Monitoring and Assessment - Biogeography Branch in partnership with
  the U.S. National Park Service (NPS), was to provide spatially-explicit information
  on the habitat types, biological cover and live coral cover of St. John's coral
  reef ecosystem. The data described herein represent ground validation (GV) sites
  explored by NOAA field scientists to further refine habitat map classification.\",\n\t\"owner_org\":
